import { Container, Row } from "react-bootstrap";
import { EventCard } from "./EventCard";
import psoc from "../assets/img/psoc.png";
import priceTiers from "../assets/img/price-tiers.png";
import videoCall from "../assets/img/video-call.png";
import 'animate.css';
import '../styles/events.css';

export const Events = () => {

  const events = [

    {
      title: "Price-tier",
      description: "A responsive price tier table with razorpay api.",
      imgUrl: priceTiers,
    },
    {
      title: "Video Call",
      description: "A beginners clone of zoom app made with webrtc and react.",
      imgUrl: videoCall,
    },
    {
      title: "PSoC",
      description: "PClub Summer Of Code landing page with next.js.",
      imgUrl: psoc,
    },

  ];

  return (
    <section className="event" id="events">
      <h2>Events</h2>
      <p>Over the span of the year, we conduct variety of events and seminars to spread awareness about our cause. Along with that, we also, move to make our environment a better place with these initiatives.</p>
      <Container>
        <Row>
            {
              events.map((event, index) => {
                return (
                  <EventCard
                    key={index}
                    {...event}
                        />
                        )})
            }
        </Row>
      </Container>
    </section>
  )
}
